from typing import Type
import pandas as pd
from .base.base_dataset import BaseDataset, DatasetConfig
from .time_series_dataset import TimeSeriesDataset

class DatasetFactory:
    def __init__(self):
        self._dataset_class: Type[BaseDataset] = TimeSeriesDataset

    def create_dataset(self, df: pd.DataFrame, config: DatasetConfig) -> BaseDataset:
        return self._dataset_class(df=df, config=config)
